cdes.instructions:
The total score is out of 10 possible points.
Normal: Score = 0 in all 5 subscales;
Mild deficit: Score = 0.5 in one subscale only;
Moderate deficit: Score = 0.5 in two, three, or four subscales; score = 1 in one subscale plus 0.5 in one subscale; score = 1 in one subscale only;
Severe deficit: Score = 0.5 in all five subscales; score = 1 in one subscale plus 0.5 in two subscales; score = 1 in at least two subscales; score = 2 in at least one subscale

Supplemental - Highly Recommended based on study type, disease stage and disease type

